import React from 'react';
// import { EditIcon, ArrowLeftIcon } from 'lucide-react-native';
// import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { NavigationContainer } from '@react-navigation/native';
import { Box, Center, Button, ButtonText, ButtonIcon, ButtonGroup, Icon, AddIcon, InfoIcon, ButtonSpinner, ArrowUpIcon, Heading, Text, HStack, VStack, ThreeDotsIcon, Input, InputField } from '@gluestack-ui/themed';
// const Stack = createNativeStackNavigator();
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import App from '../App';

const Tab = createBottomTabNavigator();

const Button1 = () => {
    <Button action={"primary"} variant={"solid"} size={"lg"} isDisabled={false}>
        <ButtonText>
            Button
        </ButtonText>
    </Button>;
};
const Button2 = () => {
    <Button action={"primary"} variant={"solid"} size={"lg"} isDisabled={false}>
        <ButtonText>
            Button
        </ButtonText>
    </Button>;
};

const HomeView = () => {
    return 
        <NavigationContainer>
            <Tab.Navigator>
                <Tab.Screen name="Home" component={App} />
            </Tab.Navigator>
        </NavigationContainer>
}
export default HomeView;
